private void initNodeLabels() {
  if (this.labels != null) {
    return;
  }
  NodeHeartbeatRequestProtoOrBuilder p = viaProto ? proto : builder;
  if (!p.hasNodeLabels()) {
    labels = null;
    return;
  }
  StringArrayProto nodeLabels = p.getNodeLabels();
  labels = new HashSet<String>(nodeLabels.getElementsList());
}
